import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { useSelector } from 'react-redux';
import Dropdown from 'react-bootstrap/Dropdown';
import { useNavigate } from 'react-router-dom';
import './navbar.css'; // Import your custom CSS file

function NavScrollExample() {
  const { userDetail } = useSelector(state => state.user);
  const navigate = useNavigate();
  
  const doLogout = () => {
    localStorage.clear();
    navigate('/');
  };

  return (
    <Navbar expand="lg" className="navbar-custom">
      <Container fluid>
        <Navbar.Brand href="#" className="navbar-brand-custom">N</Navbar.Brand>
        <Navbar.Toggle aria-controls="navbarScroll" />
        <Navbar.Collapse id="navbarScroll">
          <Nav className="me-auto my-2 my-lg-0" style={{ maxHeight: '100px' }} navbarScroll>
            <Nav.Link href="/home" className="nav-link-custom">Home</Nav.Link>
            {userDetail.role === 1 &&  <Nav.Link href="/addcourt" className="nav-link-custom">Add Player</Nav.Link>}
            <Nav.Link href="/mybookings" className="nav-link-custom">My Bookings</Nav.Link>
            <Nav.Link href="#" className="nav-link-custom" disabled>Link</Nav.Link>
          </Nav>
          <Form className="d-flex">
            <Form.Control type="search" placeholder="Search" className="me-2" aria-label="Search" />
            <Button variant="outline-success" className="btn-search">Search</Button>
            <Dropdown>
              <Dropdown.Toggle variant="success" id="dropdown-basic" className="btn-user">
                {userDetail.fname} {userDetail.lname}
              </Dropdown.Toggle>
              <Dropdown.Menu>
                <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
                <Dropdown.Item onClick={doLogout} href="#/action-2">Logout</Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
          </Form>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default NavScrollExample;
